import React from 'react'

const Title = ({pageTitle}) => {
  return (
    <div>
        <h1> {pageTitle}</h1>
    </div>
  )
}


const Body = ({pageBody}) => {
  return (
    <div>
        <div> {pageBody}</div>
    </div>
  )
}

export {Title, Body}
